    func 延迟画图动画(layer: CAShapeLayer, timeInterval: CFTimeInterval){
        strokeAnimation = CABasicAnimation(keyPath: "strokeEnd")
        strokeAnimation.fromValue = 0
        strokeAnimation.toValue = 1
        strokeAnimation.duration = timeInterval
        layer.add(strokeAnimation, forKey: "")
    }
    
    func 延迟填色动画(layer: CAShapeLayer, timeInterval: CFTimeInterval){
        fillAnimation = CABasicAnimation(keyPath: "fillColor")
        fillAnimation.fromValue = 0
        fillAnimation.toValue = 1
        fillAnimation.duration = timeInterval
        layer.add(fillAnimation, forKey: "")
    }

